import React from 'react';
import { makeStyles } from '@material-ui/core/styles';
import Chart from 'react-google-charts';

const useStyles = makeStyles({
  root: {
    height: 240,
    flexGrow: 1,
    maxWidth: 100,
  },
});

export default function FileSystemNavigator() {
  const classes = useStyles();

  return (
<Chart
  width={1000}
  height={200}
  chartType="Calendar"
  loader={<div>Loading Chart</div>}
  data={[
    [{ type: 'date', id: 'Date' }, { type: 'number', id: 'Won/Loss' }],
    [new Date(2013, 2, 4), 10],
    [new Date(2013, 2, 5), 3],
    [new Date(2013, 2, 7), -1],
    [new Date(2013, 2, 8), 2],
    [new Date(2013, 2, 12), -1],
    [new Date(2013, 2, 13), 1],
    [new Date(2013, 2, 15), 1],
    [new Date(2013, 2, 16), -4],
    [new Date(2013, 1, 4), 10],
    [new Date(2013, 1, 5), 3],
    [new Date(2013, 1, 7), -1],
    [new Date(2013, 1, 8), 2],
    [new Date(2013, 1, 12), -1],
    [new Date(2013, 1, 13), 1],
    [new Date(2013, 1, 15), 1],
    [new Date(2013, 1, 16), -4],
  ]}
  options={{
    title: 'Red Sox Attendance',
    calendar: { cellSize: 10 },
  }}
  rootProps={{ 'data-testid': '2' }}
/>
  );
}
